@OptIn(ExperimentalSerializationApi::class)
internal fun payload(context: Context, json: Json): String {
    val stream = context.assets.open("payload.json")
    val payload = json.decodeFromStream<JsonObject>(stream)
    val newPayload = payload.toMutableMap().apply {
        put("5062", JsonPrimitive(System.currentTimeMillis()))
        put("6e7c", JsonPrimitive("{}x{}".format((800..1200).random(), (1200..3000).random())))
    }
    return json.encodeToString(newPayload)
}

internal fun uuid(): String {
    val id = UUID.randomUUID()
    val t = System.currentTimeMillis() % 100_000
    return id.toString() + t.toString()
}

@OptIn(ExperimentalStdlibApi::class)
internal fun buvidFp(payload: String): String {
    val hash3 = MurmurHash3(31u)
    return hash3.hash128x64(payload.encodeToByteArray()).map(ULong::toHexString).joinToString("")
}
